import React, { useEffect } from 'react';
import App from './../app/App.jsx';
import axios from 'axios';

function AppContainer(){

  useEffect(() => {
    axios.get('/api/auth/list-message').then((res) => {
        console.log(res);
    }).catch((e) => {
      console.log(e);
    })
  },[])

  return(
    <App />
  )
}

export default AppContainer;
